import React from 'react';
import { withStyles } from '@material-ui/styles';
import { createMuiTheme } from "@material-ui/core/styles";
import PopupState, { bindTrigger, bindPopover } from 'material-ui-popup-state';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import Button from '@material-ui/core/Button';
import ListItemText from '@material-ui/core/ListItemText';
import MenuItem from '@material-ui/core/MenuItem';
import Paper from '@material-ui/core/Paper';
import Popover from '@material-ui/core/Popover';
import DialogTitle from '@material-ui/core/DialogTitle';
import Dialog from '@material-ui/core/Dialog';


const theme = createMuiTheme({
    spacing: 4
});

const styles = {
    root: {
        display: 'flex',
        '& > *': {
            margin: theme.spacing(0),
            width: theme.spacing(20),
            height: theme.spacing(16),
        },
    },
};


const StyledMenuItem = withStyles(
    {
        root: {
            '&:focus': {

                '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
                    color: 'inherit',
                },
            },
        },
    }

)(MenuItem);

class PopState extends React.Component {


    render() {
        const classes = this.props;
        return (


            <div className={classes.root}>
                <Paper elevation={0} autoFocus button >
                    <StyledMenuItem>
                        <ListItemText primary="Delete Note" />
                    </StyledMenuItem>
                    <StyledMenuItem>
                        <ListItemText style={{ fontSize: 8 }} primary="Add Label" />
                    </StyledMenuItem>
                    <StyledMenuItem>
                        <ListItemText primary="Add Drawing" onClick='handleClick' />
                    </StyledMenuItem>
                    <StyledMenuItem>
                        <ListItemText primary="Make a copy" />
                    </StyledMenuItem>
                    <StyledMenuItem>
                        <ListItemText primary="show checkboxes" />
                    </StyledMenuItem>



                </Paper>

            </div>





        );
    }

}


export default withStyles(styles)(PopState);
